import React, {Component} from 'react';
import {Table} from 'semantic-ui-react'

import './OfferList.css';


class OfferList extends Component {

    constructor(props) {
        super(props);
    }

    list = [
        {"id": 1, "name": "Turbo oferta wakacyjna", "created": `${getFullYear}`},
        {"id": 2, "name": "Turbo oferta wakacyjna 2", "created": "2018-11-11"},
        {"id": 3, "name": "Turbo oferta wakacyjna 3", "created": "2018-11-11"},
        {"id": 4, "name": "Turbo oferta wakacyjna 4", "created": "2018-11-11"},
        {"id": 5, "name": "Turbo oferta wakacyjna 5", "created": "2018-11-11"},
        {"id": 6, "name": "Turbo oferta wakacyjna 6", "created": "2018-11-11"},
        {"id": 7, "name": "Turbo oferta wakacyjna 7", "created": "2018-11-11"},
    ];

    onRowClick(offer) {
        this.props.history.push("/createorder/" + offer.id);
    }

    render() {
        return <Table celled>
            <Table.Header>
                <Table.Row>
                    <Table.HeaderCell>Nazwa</Table.HeaderCell>
                    <Table.HeaderCell>Data dodania</Table.HeaderCell>
                </Table.Row>
            </Table.Header>
            {this.list.map(function (offer) {
                return (
                    <Table.Row
                        className="offerRow"
                        key={offer.id}
                        onClick={() => this.onRowClick(offer)}>
                        <Table.Cell>{offer.name}</Table.Cell>
                        <Table.Cell>{offer.created}</Table.Cell>
                    </Table.Row>
                )

            }, this)}
        </Table>
    }

}

export default OfferList;
